// src/pages/SignUpPage.js
import React from 'react';
import SignUpForm from '../components/SignUpForm';
import '../styles/SignUpForm.css';

const SignUpPage = () => {
  return (
    <div className="sign-up-page">
      <SignUpForm />
    </div>
  );
};

export default SignUpPage;
